import React from "react";
import { BrowserRouter as Router, Route, Switch } from "react-router-dom"; // Import Router and Route
import Navbar from "./components/Navbar";
import Cover from "./components/Cover";
import Kitchen from "./components/Kitchen";  // Import Kitchen component
import './App.css';

function App() {
  return (
    <Router>
      <Navbar />
      <Switch>
        <Route exact path="/" component={Cover} />  {/* Home page */}
        <Route path="/kitchen" component={Kitchen} />  {/* Kitchen page */}
        {/* Add more routes for other pages here */}
      </Switch>
    </Router>
  );
}

export default App;
